const handleAlbums = async () => {
  // const response = await fetch('http://localhost:3000/albums')
  const response = await fetch("https://api.setlist.fm/rest/1.0/search/setlists?artistMbid=20244d07-534f-4eff-b4d4-930878889970&p=1&tourName=eras%20tour",
  {
    method: 'GET',
    headers: {
      "Access-Control-Allow-Origin": "*",
      'Accept': 'application/json',
      'x-api-key': 'aMvKoQBanfFQgO0HR7McxeD4y6j3itSYcEoR'
    }
  })
  console.log(response)
  const data = await response.json()
  return data
}

const putAlbum = async (album) => {
  const response = await fetch(`http://localhost:3000/albums/${album.id}`, {
    method: 'PUT',
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify(album)
  })
  console.log(response)
  const data = await response.json()
  return data
}

// patchAlbum()


export { handleAlbums, putAlbum }
